// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract StanBuck {
  string public constant name = "StanBuck";
  string public constant symbol = "SBX";
  uint8 public constant decimals = 8;

  // ... other constants / variables here.
  uint256 private _totalSupply;
  mapping (address => uint256) private balances;
  mapping (address => mapping(address => uint256)) private allowances;

  constructor(uint256 _initialSupply) public{
        _totalSupply = _initialSupply;
        balances[msg.sender] = _initialSupply;
  }

  // You must emit these events when certain triggers occur (see the ERC-20 spec).
  event Approval(address indexed _from, address indexed _to, uint256 _value);
  event Transfer(address indexed _owner, address indexed _spender, uint256 _value);

  function totalSupply() public view returns (uint256) {
    return _totalSupply;
  }


  function balanceOf(address _owner) public view returns (uint) {
    return balances[_owner];
  }

  function transfer(address _to, uint256 _value) public returns (bool) {
    require(balances[msg.sender] >= _value);

    balances[msg.sender] -= _value;
    balances[_to] += _value;
    emit Transfer(_to, msg.sender, _value);

    return true;
  }

  function transferFrom(address _from, address _to, uint256 _value) public returns (bool) {
    require(balances[_from] >= _value);
    require(allowances[_to][_from] >= _value);

    balances[_from] -= _value;
    allowances[_to][_from] -= _value;
    balances[_to] += _value;
    emit Transfer(_to, _from, _value);

    return true;
  }

  function approve(address _spender, uint256 _value)  public returns (bool) {
    allowances[_spender][msg.sender] = _value;
    emit Approval(_spender, msg.sender, _value);

    return true;
  }

  function allowance(address _owner, address _spender) public view returns (uint) {
    return allowances[_spender][_owner];
  }
}
